    Edward Ryan dated April 8, 2008, we have investigated our filings and have determined
    that the disbursement made on 9/26/2007 to Steve Chabot for Congress in the amount
    of $2,500 was incorrectly reported as a contribution to the 2008 General Election.
    \ That contribution should be been reported as a disbursement to the 2008 Primary
    Election.  This amendment to our 2007 October Quarterly filing corrects this reporting
    error.  Thank you.\n"
